import React from 'react';
import {View,Text, StyleSheet, TouchableOpacity, Image} from 'react-native';
import Constants from  'expo-constants';
import {Feather as Icon} from '@expo/vector-icons'; 
import {useNavigation} from '@react-navigation/native';
import {RectButton} from 'react-native-gesture-handler';

const Details = () => {

    const navigation = useNavigation();
    function handleNavigateBack() {
        navigation.navigate('Home');
    }

    return (
    <>
        <View style={styles.container}>
            <TouchableOpacity>
                <Icon name="arrow-left" size={20} color="#34cb29" onPress={handleNavigateBack} />
            </TouchableOpacity>

            <Image style={styles.pointImage} source={{uri:'https://images.unsplash.com/photo-1542838132-92c53300491e?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=400&q=60'}} />
            <Text style={styles.pointName}>Mercado do seu Zé</Text>
            <Text style={styles.pointItems}>Lampadas, Óleo de cozinha, Guaraná</Text>

            <View style={styles.address}>
                <Text style={styles.addressTitle}>Endereço</Text>
                <Text style={styles.addressContent}>Sebastião Laranjeiras / BA</Text>
            </View>
        </View>
        <View style={styles.footer}>
            <RectButton style={styles.button}>
                <Text style={styles.buttonText}></Text>
            </RectButton>
        </View>
    </>
        );
}

const styles = StyleSheet.create({
    container: {
      flex: 1,
      padding: 32,
      paddingTop: 20,
    },

    pointImage: {
      width: '100%',
      height: 120,
      resizeMode: 'cover',
      borderRadius: 10,
      marginTop: 32,
    },

    pointName: {
      color: '#322153',
      fontSize: 28,
      fontFamily: 'Ubuntu_700Bold',
      marginTop: 24,
    },

    pointItems: {
      fontFamily: 'Roboto_400Regular',
      fontSize: 16,
      lineHeight: 24,
      marginTop: 8,
      color: '#6C6C80'
    },

    address: {
      marginTop: 32,
    },

    addressTitle: {
      color: '#322153',
      fontFamily: 'Roboto_500Medium',
      fontSize: 16,
    },

    addressContent: {
      fontFamily: 'Roboto_400Regular',
      lineHeight: 24,
      marginTop: 8,
      color: '#6C6C80'
    },

    footer: {
      borderTopWidth: StyleSheet.hairlineWidth,
      borderColor: '#999',
      paddingVertical: 20,
      paddingHorizontal: 32,
      flexDirection: 'row',
      justifyContent: 'space-between'
    },

    button: {
      width: '48%',
      backgroundColor: '#34CB79',
      borderRadius: 10,
      height: 50,
      flexDirection: 'row',
      justifyContent: 'center',
      alignItems: 'center'
    },

    buttonText: {
      marginLeft: 8,
      color: '#FFF',
      fontSize: 16,
      fontFamily: 'Roboto_500Medium',
    },
  });

export default Details;
